filter_expression:
{"script": "BEGIN
    RETURN (year($AEDAT) = year(sysdate())) AND 
           ($BSART = 'LPA' OR $BSART = 'LP') AND 
           ($EKORG = '2032' OR $EKORG = '4510' OR $EKORG = '4991' OR 
           $EKORG = '5153' OR $EKORG = '9080' OR $EKORG = 'LOGA' OR $EKORG = 'EDLA');
END", "errors": []}

{"script": "BEGIN
  RETURN $LVORM = 'X' AND $YPRCTRUGB != 'initial' AND $YPRODHUGB != 'initial' AND match_pattern($YPRODHUGB, '[!E]*') AND ( $MTART = 'FERT' OR $MTART = 'HAWA' OR $MTART = 'DIEN' OR $MTART = 'MUBL' ) AND ( $MSTAE = 40 OR $MSTAE = 49 )
;
END", "errors": []}

rule_expression:
{"script": "BEGIN
  RETURN NOT ( match_pattern($ATTACH_URL, '*DUMMY') OR match_pattern($ATTACH_URL, '*TEST') OR match_pattern($ATTACH_URL, '*test') OR match_pattern($ATTACH_URL, '*dummy') )
;
END", "errors": []}

{"script": "BEGIN
  RETURN $NTGEW IS NOT NULL AND $NTGEW != 0.0 AND $BRGEW IS NOT NULL AND $BRGEW != 0.0 AND $NTGEW = $BRGEW
;
END", "errors": []}

{"script": "BEGIN
  RETURN $FUNC_AREA = $REF_FUNC_AREA OR ( $FUNC_AREA IS NULL AND $REF_FUNC_AREA IS NULL )
;
END", "errors": []}

{"script": "DECLARE
    # define variables
    $TODAY date;
BEGIN
    $TODAY = sysdate();
    # define condition script
    if (($DATAB < $TODAY) AND ($DATBI > $TODAY) AND ($REF_MSEHI = $MSEHI) AND ($REF_EIGEN = $EIGEN) AND ($REF_KATYP = $KATYP) ) 
    RETURN TRUE;
    else
    RETURN FALSE;
END", "errors": []}

{"script": "BEGIN
  RETURN ( $REF_KTEXT = $KTEXT OR ( $KTEXT IS NULL AND $REF_KTEXT IS NULL ) ) AND ( $REF_LTEXT = $LTEXT OR ( $LTEXT IS NULL AND $REF_LTEXT IS NULL ) )
;
END", "errors": []}
